import React from "react";
import { Redirect } from "react-router-dom";
import { AuthConsumer } from "../authContext";
import Login from "../components/Login";

const HomePage = () => (
  <AuthConsumer>
    {({ authenticated }) =>
      authenticated ? (
        <Redirect to="/driver" />
      ) : (
        <div>
          <h2>Snowline Alaska.</h2>
          <Login />
        </div>
      )
    }
  </AuthConsumer>
);

export default HomePage;
